        /// <summary>Returns a uint hash code of a I32x3 vector.</summary>
        /// <param name="v">Vector value to hash.</param>
        /// <returns>uint hash of the argument.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static uint hash(I32x3 v)
        {
            return csum(AsU32(v) * new U32x3(0x4C7F6DD1u, 0x4822A3E9u, 0xAAC3C25Du)) + 0xD21D0945u;
        }

        /// <summary>
        /// Returns a U32x3 vector hash code of a I32x3 vector.
        /// When multiple elements are to be hashes together, it can more efficient to calculate and combine wide hash
        /// that are only reduced to a narrow uint hash at the very end instead of at every step.
        /// </summary>
        /// <param name="v">Vector value to hash.</param>
        /// <returns>U32x3 hash of the argument.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static U32x3 hashwide(I32x3 v)
        {
            return (AsU32(v) * new U32x3(0x88FCAB2Du, 0x614DA60Du, 0x5BA2C50Bu)) + 0x8C455ACBu;
        }

        /// <summary>Returns the result of specified shuffling of the components from two I32x3 vectors into an int value.</summary>
        /// <param name="left">I32x3 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">I32x3 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting int.</param>
        /// <returns>int result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static int shuffle(I32x3 left, I32x3 right, ShuffleComponent x)
        {
            return select_shuffle_component(left, right, x);
        }

