        /// <summary>Returns the result of specified shuffling of the components from two I32x3 vectors into an I32x4 vector.</summary>
        /// <param name="left">I32x3 to use as the left argument of the shuffle operation.</param>
        /// <param name="right">I32x3 to use as the right argument of the shuffle operation.</param>
        /// <param name="x">The ShuffleComponent to use when setting the resulting I32x4 x component.</param>
        /// <param name="y">The ShuffleComponent to use when setting the resulting I32x4 y component.</param>
        /// <param name="z">The ShuffleComponent to use when setting the resulting I32x4 z component.</param>
        /// <param name="w">The ShuffleComponent to use when setting the resulting I32x4 w component.</param>
        /// <returns>I32x4 result of the shuffle operation.</returns>
        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        public static I32x4 shuffle(I32x3 left, I32x3 right, ShuffleComponent x, ShuffleComponent y, ShuffleComponent z, ShuffleComponent w)
        {
            return new I32x4(
                select_shuffle_component(left, right, x),
                select_shuffle_component(left, right, y),
                select_shuffle_component(left, right, z),
                select_shuffle_component(left, right, w));
        }

        [MethodImpl(MethodImplOptions.AggressiveInlining)]
        internal static int select_shuffle_component(I32x3 a, I32x3 b, ShuffleComponent component)
        {
            switch(component)
            {
                case ShuffleComponent.LeftX:
                    return a.x;
                case ShuffleComponent.LeftY:
                    return a.y;
                case ShuffleComponent.LeftZ:
                    return a.z;
                case ShuffleComponent.RightX:
                    return b.x;
                case ShuffleComponent.RightY:
                    return b.y;
                case ShuffleComponent.RightZ:
                    return b.z;
                default:
                    throw new System.ArgumentException("Invalid shuffle component: " + component);
            }
        }

